msg_begin	id=1178	UNK_0=1	message=[Эта Печать дает группе, владеющей ею, эксклюзивный вход в подземелье, открывающееся Печатью Алчности в период действия Печатей. Также она позволяет вести дела с Торговцами Маммона, которые находятся в особых подземельях. Также она позволяет встретиться с Анаким или Лилит в Некрополе Апостолов.]	group=0	color=799BB0FF	sound=[None]	voice=[None]	win=0	font=0	lftime=0	bkg=0	anim=0	scrnmsg=[]	gfxscrnmsg=[]	gfxscrnparam=[]	type=[none]	msg_end
msg_begin	id=1179	UNK_0=1	message=[Эта Печать позволяет группе, владеющей ею, проникнуть в подземелье, открывающееся Печатью Познания, пользоваться услугами телепортации, которые предоставляет жрец в деревне, и вести дела с Кузнецами Маммона. Появляется Оратор Откровений и заклинает положительными эффектами победителей. Появляется Проповедник Судьбы и заклинает отрицательными эффектами проигравших.]	group=0	color=799BB0FF	sound=[None]	voice=[None]	win=0	font=0	lftime=0	bkg=0	anim=0	scrnmsg=[]	gfxscrnmsg=[]	gfxscrnparam=[]	type=[none]	msg_end
